import React from 'react'
import "./order.css"

export default function Order({order}) {
    console.log(order)
  return (
      
    <div>
        <p>{order.status}</p>
       <p>{order.address}</p>
       <p>{order.customer}</p>
       <p>{order.orderItems.map((food)=>{
           return <div>
               <p>{food.name} <span>${food.price}</span></p>
                
           </div>
       })}</p>
       <p>Total Price : $ {order.total}</p>
    </div>
  )
}
